import { View, Text, Pressable } from "react-native";
import React from "react";
import Ionicons from "react-native-vector-icons/Ionicons";
import FontAwesomeIcons from "react-native-vector-icons/FontAwesome5";

// CSS styles
const styles = {
  container: {
    backgroundColor: "white",
    marginBottom: 10,
  },
  sectionTitle: {
    marginLeft: 10,
    paddingTop: 10,
    fontSize: 14,
    color: "#0069fc",
    fontWeight: "bold",
  },
  listItemContainer: {
    flexDirection: "row",
    alignItems: "center",
    marginLeft: 10,
    marginTop: 10,
    paddingVertical: 10,
    borderBottomWidth: 1,
    borderBottomColor: "#ccc",
  },
  listItemText: {
    flex: 1,
    fontSize: 16,
    paddingLeft: 10,
  },
  listItemSubText: {
    fontSize: 12,
    color: "#a5a9aa",
    width: 80,
    textAlign: "right",
  },
};

const PersonalPrivacy = ({ navigation }) => {
  navigation.setOptions({
    headerTitle: () => (
      <View style={{ flexDirection: "row", alignItems: "center" }}>
        <Text style={{ color: "white", fontSize: 20, fontWeight: "bold" }}>
          Quyền riêng tư
        </Text>
      </View>
    ),
    headerStyle: {
      backgroundColor: "#0091FF",
      shadowColor: "#fff",
    },
    headerTintColor: "#fff",
    headerTitleStyle: {
      fontSize: 20,
    },
  });

  return (
    <View>
      {/* Body */}
      <View>
        {/* Cá nhân */}
        <View style={styles.container}>
          <Text style={styles.sectionTitle}>Cá nhân</Text>
          <Pressable style={styles.listItemContainer}>
            <Ionicons
              name="calendar-outline"
              size={26}
              color="#a5a9aa"
            ></Ionicons>
            <Text style={styles.listItemText}>Sinh nhật</Text>
            <Ionicons name="arrow-forward" size={22} color="#a5a9aa"></Ionicons>
          </Pressable>
          <Pressable style={styles.listItemContainer}>
            <Ionicons
              name="person-circle-outline"
              size={26}
              color="#a5a9aa"
            ></Ionicons>
            <Text style={styles.listItemText}>Hiện trạng thái truy cập</Text>
            <Text style={styles.listItemSubText}>Đang bật</Text>
          </Pressable>
        </View>
        {/* Tin nhắn và cuộc gọi */}
        <View style={styles.container}>
          <Text style={styles.sectionTitle}>Tin nhắn và cuộc gọi</Text>
          <Pressable style={styles.listItemContainer}>
            <Ionicons
              name="chatbubble-outline"
              size={24}
              color="#a5a9aa"
            ></Ionicons>
            <Text style={styles.listItemText}>Hiện trạng thái "Đã xem"</Text>
            <Text style={styles.listItemSubText}>Đang tắt</Text>
          </Pressable>
          <Pressable style={styles.listItemContainer}>
            <Ionicons
              name="chatbubble-ellipses-sharp"
              size={24}
              color="#a5a9aa"
            ></Ionicons>
            <Text style={styles.listItemText}>Cho phép tin nhắn</Text>
            <Text style={styles.listItemSubText}>Mọi người</Text>
          </Pressable>
          <Pressable style={styles.listItemContainer}>
            <Ionicons name="call-outline" size={24} color="#a5a9aa"></Ionicons>
            <Text style={styles.listItemText}>Cho phép gọi điện</Text>
            <Text style={styles.listItemSubText}>
              Bạn bè và người lạ từng liên hệ
            </Text>
          </Pressable>
        </View>
        {/* Nhật ký*/}
        <View style={styles.container}>
          <Text style={styles.sectionTitle}>Nhật ký</Text>
          <Pressable style={styles.listItemContainer}>
            <FontAwesomeIcons
              name="pen-square"
              size={22}
              color="#a5a9aa"
            ></FontAwesomeIcons>
            <Text style={styles.listItemText}>Cho phép xem và bình luận</Text>
            <Ionicons name="arrow-forward" size={22} color="#a5a9aa"></Ionicons>
          </Pressable>
